'use strict';

/**
* Fisher's F distributed pseudorandom numbers.
*
* @module @stdlib/math/base/random/f
*
* @example
* var f = require( '@stdlib/math/base/random/f' );
*
* var v = f( 5.0, 3.0 );
* // returns <NonNegativeNumber>
*
* @example
* var factory = require( '@stdlib/math/base/random/f' ).factory;
*
* var f = factory( 3.0, 2.0, {
* 	'seed': 297
* });
*
* var v = f();
* // returns <NonNegativeNumber>
*/

// MODULES //

var setReadOnly = require( '@stdlib/utils/define-read-only-property' );
var f = require( './f.js' );
var factory = require( './factory.js' );


// METHODS //

setReadOnly( f, 'factory', factory );


// EXPORTS //

module.exports = f;
